package com.aistudio.kaidzentracker.android.data.localDataSource.fiveSDataSourceimport androidx.room.*@Daointerface FiveSDao {    @Insert(onConflict = OnConflictStrategy.REPLACE)    suspend fun insertLocalSource(fiveSEntity: FiveSEntity)    @Query("SELECT * FROM fiveSEntity")    suspend fun getLocalSource(): FiveSEntity?    @Query("DELETE FROM fiveSEntity")    suspend fun deleteLocalSource()}